/* global env */
/* eslint-disable */
let {
Signal,
Resources,
sockets,
box,
Input,
Output,
OutputAll,
getMeta
} = env
/* esltint-enable */
console.log(`========  ${box.name} is Ready.  ========`)
// sender

let startTime = performance.now() / 1000

Input('onFrame', (evt) => {
let timeMode = window.top[box.id + '-timeMode']
let progress = window.top[box.id + '-progress']
// console.log(timeMode)

let timetracks = box.meta.filter(e => e.type === 'timeline-track')
timetracks.forEach((m, mi) => {
  let time = 0

  if (timeMode === 'toEnv') {
    time = (progress * m.value.totalTime)
  } else {
    time = evt.time / 1000 - startTime
    if (time > m.value.totalTime) {
      startTime = evt.time / 1000
    }
  }

  updateTimeValue({ time, mVal: m.value, totalTime: m.value.totalTime })
})

// tell UI
if (timetracks.length > 0) {
  let m = timetracks[0]
  let time = performance.now() / 1000 - startTime
  window.top.postMessage({ type: 'timeline', modID: box.id, time, totalTime: m.value.totalTime, progress: time / m.value.totalTime }, window.location.origin)
}
})


let updateTimeValue = ({ time, mVal, totalTime }) => {
mVal.time = time

// ---------------------------------
// periods
//  starting
if (time >= mVal.start && time <= mVal.afterStart) {
  let progress = (time - mVal.start) / (mVal.afterStart - mVal.start)
  mVal.starting = progress
  mVal.mode = 'starting'
  mVal.var = progress
}

// periods
// during
if (time >= mVal.afterStart && time <= mVal.beforeEnd) {
  let progress = (time - mVal.afterStart) / (mVal.beforeEnd - mVal.afterStart)
  mVal.during = progress
  mVal.mode = 'during'
  mVal.var = 1.0
}

// periods
//  leaving
if (time >= mVal.beforeEnd && time <= mVal.end) {
  let progress = 1.0 - (mVal.end - time) / (mVal.end - mVal.beforeEnd)
  mVal.leaving = 1.0 - progress
  mVal.mode = 'leaving'
  mVal.var = 1.0 - progress
}

// ---------------------------------

// overriders
// before start
if (time < mVal.start) {
  let progress = 0
  mVal.starting = 0
  mVal.mode = 'beforeStart'
  mVal.beforeStart = 0
  mVal.var = 0
}

// after end
if (time > mVal.end) {
  let progress = 0
  mVal.leaving = 0
  mVal.afterEnd = 0
  mVal.mode = 'afterEnd'
  mVal.var = 0
}

// timebox mVal
// timebox
if (time >= mVal.start && time <= mVal.end) {
  let progress = (time - mVal.start) / (mVal.end - mVal.start)
  mVal.timebox = progress
}

mVal.tick = time / totalTime
mVal.now = time
};

let event = {
$ready: true
}
let toObject = (key) => {
event[key] = getMeta(key)
}
Input('onFrame', (v) => {
box.meta.filter(e => e.type === 'timeline-track').forEach((m, mi) => {
  toObject(m.label);
});

OutputAll(event);
});


