  getMeta
} = env
/* esltint-enable */
console.log(`========  ${box.name} is Ready.  ========`)
window.global = window;

Resources.js.need('whammy', [
	'https://cdn.jsdelivr.net/npm/whammy@0.0.1/whammy.min.js'
]);



Resources.ensure(['whammy', 'renderer']).then(() => {
  let encoder = new Whammy.Video(60)
  let evt = {
    time: 0,
    total: getMeta('secondsToRecrod') * 1000,
    encoder
  }

  let canRecord = outputs[0].socket.to !== '' && !!outputs[0].socket.to;


  let root = Resources.get('rootDOM');

  function shouldContinue (evt) {
    return evt.time < evt.total
  }
  let span = document.createElement('a')
  span.style.position = 'fixed';
  span.style.top = '0px';
  span.style.left = '0px';
  span.style.width = '100%';
  span.style.backgroundColor = 'white';

  let renderer = Resources.get('renderer');

  let tout = 0
  function loop () {
    Output('onClock', evt)  
    evt.time += 1000 / 60
    span.innerHTML = (evt.time / evt.total * 100).toFixed(2) + '% recorded'
    if (shouldContinue(evt)) {
      root.appendChild(span);
      let link = renderer.domElement.toDataURL('image/webp');
      evt.encoder.add(link)
      tout = setTimeout(loop, 0)  
    } else {
      evt.encoder.compile(false, (webm) => {
        console.log(webm)
        let a = document.createElement('a')
        a.href = URL.createObjectURL(webm)
        a.download = 'video'
        a.style.position = 'fixed';
        a.style.top = '0px';
        a.style.left = '0px';
        a.style.width = '100%';
        a.style.backgroundColor = 'white';
        a.innerText = 'Donwload'

        console.log(root);
        root.appendChild(a)
      })
    }
  }

  //Resources.set('recordReady', encoder)

  if (canRecord) {
    loop()
  }

});

