	var renderer = new THREE.WebGLRenderer({ preserveDrawingBuffer: true, antialias: true, alpha: true });
	var camera = new THREE.PerspectiveCamera( 75, 1.0, 0.1, 1000 );
	var scene = new THREE.Scene()

	camera.position.z = 200;

	var controls = new THREE.OrbitControls(camera, renderer.domElement);

	var composer = false
	Resources.ensure(['composer']).then(() => {
	  composer = Resources.get('composer')
	});

  renderer.domElement.style.marginBottom = '-6px';
