  Input('onFrame', (v) => {
    if (scene) {
      if (composer) {
        composer.render();
      } else {
        renderer.render(scene, camera);
      }
    }

    controls.update()
    Output('onFrame', v)
    Output('onScene', scene)
  })


  // pass through render signal
