  //   Signal.$emit(outputs[0].id, progress);
  //   if (composer) {
  //     composer.render();
  //   } else {
  //     renderer.render(scene, camera);
  //   }
  //   controls.update()
  // });

  // on resizer
  var rectCache = {
    width: 0,
    height: 0
  }

  Input('onResize', (info) => {
    if (rectCache.width !== info.rect.width || rectCache.height !== info.rect.height) {
      rectCache.width = info.rect.width
      rectCache.height = info.rect.height
      camera.aspect = rectCache.width / rectCache.height;
    	camera.updateProjectionMatrix();
      renderer.setPixelRatio(window.devicePixelRatio || 1.0);
      renderer.setSize(rectCache.width, rectCache.height);
    }
    renderer.domElement.style.visibility = 'visible';
    Output('onResize', info);
  });
});

