let updateTimeValue = ({ time, mVal, totalTime }) => {
  mVal.time = time

  // ---------------------------------
  // periods
  //  starting
  if (time >= mVal.start && time <= mVal.afterStart) {
    let progress = (time - mVal.start) / (mVal.afterStart - mVal.start)
    mVal.starting = progress
    mVal.mode = 'starting'
    mVal.var = progress
  }

  // periods
  // during
  if (time >= mVal.afterStart && time <= mVal.beforeEnd) {
    let progress = (time - mVal.afterStart) / (mVal.beforeEnd - mVal.afterStart)
    mVal.during = progress
    mVal.mode = 'during'
    mVal.var = 1.0
  }

  // periods
  //  leaving
  if (time >= mVal.beforeEnd && time <= mVal.end) {
    let progress = 1.0 - (mVal.end - time) / (mVal.end - mVal.beforeEnd)
    mVal.leaving = 1.0 - progress
    mVal.mode = 'leaving'
    mVal.var = 1.0 - progress
  }

  // ---------------------------------

  // overriders
  // before start
  if (time < mVal.start) {
    let progress = 0
    mVal.starting = 0
    mVal.mode = 'beforeStart'
    mVal.beforeStart = 0
    mVal.var = 0
  }

  // after end
  if (time > mVal.end) {
    let progress = 0
    mVal.leaving = 0
    mVal.afterEnd = 0
    mVal.mode = 'afterEnd'
    mVal.var = 0
  }

  // timebox mVal
  // timebox
  if (time >= mVal.start && time <= mVal.end) {
    let progress = (time - mVal.start) / (mVal.end - mVal.start)
    mVal.timebox = progress
  }

  mVal.tick = time / totalTime
  mVal.now = time
};

