function particleSea () {
  var api = {}

  var WIDTH = 256
  var BOUNDS = 256

  var gpuCompute
  var positionVariable
  var velocityVariable
  var particleShader

  function fillTexture (texture) {
    // var waterMaxHeight = 10
    // function noise(x, y, z) {
    //   var multR = waterMaxHeight
    //   var mult = 0.025
    //   var r = 0
    //   for (var i = 0; i < 15; i++) {
    //     r += multR * simplex.noise(x * mult, y * mult)
    //     multR *= 0.53 + 0.025 * i
    //     mult *= 1.25
    //   }
    //   return r
    // }
    var pixels = texture.image.data
    var p = 0
    for (var j = 0; j < WIDTH; j++) {
      for (var i = 0; i < WIDTH; i++) {
        var x = (WIDTH / 2 - i) * 128 / WIDTH
        var y = (WIDTH / 2 - j) * 128 / WIDTH

        pixels[ p + 0 ] = x
        pixels[ p + 1 ] = y

        pixels[ p + 2 ] = 0// noise(Math.sin(x), Math.sin(y), 0.0)
        // pixels[ p + 1 ] = 0
        // pixels[ p + 2 ] = 0
        pixels[ p + 3 ] = 0
        p += 4
      }
    }
  }

  function setupCompute ({ renderer }) {
    gpuCompute = new GPUComputationRenderer(WIDTH, WIDTH, renderer)

    var positionTexture = gpuCompute.createTexture()
    fillTexture(positionTexture)
    positionVariable = gpuCompute.addVariable('positionInfo', particlePositionShader, positionTexture)
    positionVariable.material.uniforms.mousePos = {
      value: new THREE.Vector2(0, 0)
    }

    var velocityTexture = gpuCompute.createTexture()
    velocityVariable = gpuCompute.addVariable('velocityInfo', particleVelocityShader, velocityTexture)
    velocityVariable.material.defines.BOUNDS = BOUNDS.toFixed(1)
    velocityVariable.wrapS = THREE.ClampToEdgeWrapping
    velocityVariable.wrapT = THREE.ClampToEdgeWrapping
    velocityVariable.material.uniforms.mousePos = {
      value: new THREE.Vector2(0, 0)
    }

    api.setMouse = ({ mX, mY, rect }) => {
      var posMouse = velocityVariable.material.uniforms.mousePos.value
      var velMouse = positionVariable.material.uniforms.mousePos.value
      if (rect && typeof mX !== 'undefined' && typeof mY !== 'undefined') {
        velMouse.x = ((mX - rect.left) / rect.width) * 2 - 1
        velMouse.y = -((mY - rect.top) / rect.height) * 2 + 1
        posMouse.x = ((mX - rect.left) / rect.width) * 2 - 1
        posMouse.y = -((mY - rect.top) / rect.height) * 2 + 1

        velMouse.y *= rect.width / rect.height
        posMouse.y *= rect.width / rect.height
        // console.log(mouse)
      }
    }

    gpuCompute.setVariableDependencies(positionVariable, [positionVariable, velocityVariable])
    gpuCompute.setVariableDependencies(velocityVariable, [positionVariable, velocityVariable])

    var error = gpuCompute.init()
    if (error !== null) {
      console.error(error)
    }
    return {}
  }
  var starLightGeo = (nx = 100, ny = 100) => {
    var geometry = new THREE.BufferGeometry();
    var headTailValueVec3 = []
    var indexValueVec3 = []
    var randomValueVec3 = []
    var positionValueVec3 = [
    ];
    let uvValueVec2 = [];
    let numLiunes = nx * ny
    let n = numLiunes;
    let tempV3 = new THREE.Vector3(0,0,0);
    let temp2V3 = new THREE.Vector3(0,0,0);

    for (var iy = 0; iy < ny; iy++) {
      for (var ix = 0; ix < nx; ix++) {
        let i = ix + iy * ny;

        let xx = ix / nx;
        let yy = iy / ny;

        let x1 = 0;
        let y1 = 0;
        let z1 = 0;

        let x2 = 0;
        let y2 = 0;
        let z2 = 0;

        tempV3.set(x2, y2, z2);
        temp2V3.set(0.0, 0.0, 1.0);
        tempV3.applyAxisAngle(temp2V3, Math.PI * 2.0 * 60 / 360);

        x2 = tempV3.x
        y2 = tempV3.y
        z2 = tempV3.z

        let r1x = Math.random()
        let r1y = Math.random()
        let r1z = Math.random()
        let r2x = 0
        let r2y = 0
        let r2z = 0

        let idx = i / n

        if (i % 2 === 0) {
          uvValueVec2.push(xx, yy);

          headTailValueVec3.push(1.0, 1.0, 1.0);
          indexValueVec3.push(idx, idx, idx);
          randomValueVec3.push(r1x, r1y, r1z);
          positionValueVec3.push(x1, y1, z1);

          uvValueVec2.push(xx, yy);

          headTailValueVec3.push(0.0, 0.0, 0.0);
          indexValueVec3.push(idx, idx, idx);
          randomValueVec3.push(r2x, r2y, r2z);
          positionValueVec3.push(x2, y2, z2);
        }

        // if (i % 2 === 0) {
        //   uvValueVec2.push(xx, yy);

        //   headTailValueVec3.push(1.0, 1.0, 1.0);
        //   indexValueVec3.push(idx, idx, idx);
        //   randomValueVec3.push(r1x, r1y, r1z);
        //   positionValueVec3.push(x1, y1, z1);


        // } else {
        //   uvValueVec2.push(xx, yy);

        //   headTailValueVec3.push(0.0, 0.0, 0.0);
        //   indexValueVec3.push(idx, idx, idx);
        //   randomValueVec3.push(r2x, r2y, r2z);
        //   positionValueVec3.push(x2, y2, z2);
        // }
      }
    }



    geometry.addAttribute('uv', new THREE.BufferAttribute(new Float32Array(uvValueVec2), 2));
    geometry.addAttribute('position', new THREE.BufferAttribute(new Float32Array(positionValueVec3), 3));
    geometry.addAttribute('randV3', new THREE.BufferAttribute(new Float32Array(randomValueVec3), 3));
    geometry.addAttribute('idxV3', new THREE.BufferAttribute(new Float32Array(indexValueVec3), 3));
    geometry.addAttribute('htV3', new THREE.BufferAttribute(new Float32Array(headTailValueVec3), 3));

    return geometry
  }

  function setupScene () {
    var material = particleShader = new THREE.ShaderMaterial({
      blending: THREE.AdditiveBlending,
      depthTest: false,
      transparent: true,
      uniforms: {
        positionInfo: {
          value: null
        },
        velocityInfo: {
          value: null
        },
        mixColor: {
          value: new THREE.Color(0xffffff)
        },
        opacity: {
          value: 0.14
        },
        pointSize: {
          value: 1.0
        }
      },
      vertexShader: particleVertexShader,
      fragmentShader: particleFragmentShader // THREE.ShaderChunk[ 'meshphong_frag' ]
    })

    material.defines.WIDTH = WIDTH.toFixed(1)
    material.defines.BOUNDS = BOUNDS.toFixed(1)

    var geometry = new THREE.PlaneBufferGeometry(BOUNDS, BOUNDS, WIDTH - 1, WIDTH - 1);

    geometry = starLightGeo(WIDTH, WIDTH);

    var points = new THREE.LineSegments(geometry, material);
    // points = new THREE.Points( geometry, material );
    // points.rotation.x = -Math.PI / 2 * 0;
    //points.matrixAutoUpdate = false
    //points.updateMatrix()

    return {
      updateColor (v) {
        material.uniforms.mixColor.value.set(v)
      },
      updateOpacity (v) {
        material.uniforms.opacity.value = v
      },
      updatePointSize (v) {
        material.uniforms.pointSize.value = v
      },
      points
    }
  }

  function setup ({ renderer }) {
    setupCompute({ renderer })
    let scn = setupScene()
    Object.keys(scn).forEach(kn => {
      api[kn] = scn[kn]
    })
    return api
  }
  api.setup = setup

  function render () {
    // @.@
    particleShader.uniforms.positionInfo.value = gpuCompute.getCurrentRenderTarget(positionVariable).texture
    particleShader.uniforms.velocityInfo.value = gpuCompute.getCurrentRenderTarget(velocityVariable).texture
    gpuCompute.compute()
  }
  api.render = render

  return api
}

